css:
.editor-colors {
  background-color: #000000;
  color: #dfe1e0;
}
.editor {
  background-color: #000000;
  color: #dfe1e0;
}
.editor .wrap-guide {
  background-color: #282a2e;
}
.editor .indent-guide {
  color: #373b41;
}
.editor .invisible-character {
  color: #373b41;
}
.editor .gutter {
  background-color: #111213;
  color: #c5c8c6;
}
.editor .gutter .line-number.cursor-line {
  background-color: #1d1f21;
  color: #c5c8c6;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #c5c8c6;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #969896;
}
.editor .invisible {
  color: #dfe1e0;
}
.editor .cursor {
  color: #ffffff;
}
.editor .selection .region {
  background-color: #404349;
}
.comment {
  color: #636563;
}
.entity.name.type {
  color: #ffa800;
}
.entity.other.inherited-class {
  color: #5acd00;
}
.keyword {
  color: #efb0ff;
}
.keyword.control {
  color: #00d0ff;
}
.keyword.operator {
  color: #dfe1e0;
}
.keyword.other.special-method {
  color: #0089ff;
}
.keyword.other.unit {
  color: #f2883f;
}
.storage {
  color: #e57dff;
}
.constant {
  color: #f2883f;
}
.constant.character.escape {
  color: #43d4c0;
}
.constant.numeric {
  color: #f2883f;
}
.constant.other.color {
  color: #43d4c0;
}
.constant.other.symbol {
  color: #5acd00;
}
.variable {
  color: #de6262;
}
.variable.interpolation {
  color: #d53838;
}
.variable.parameter.function {
  color: #dfe1e0;
}
.invalid.illegal {
  background-color: #de6262;
  color: #000000;
}
.string {
  color: #5acd00;
}
.string.regexp {
  color: #43d4c0;
}
.string.regexp .source.ruby.embedded {
  color: #f2883f;
}
.string.other.link {
  color: #de6262;
}
.punctuation.definition.comment {
  color: #969896;
}
.punctuation.definition.string {
  color: #ffde00;
}
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #dfe1e0;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #0089ff;
}
.punctuation.definition.bold {
  color: #ffa800;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #e57dff;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #d53838;
}
.support.class {
  color: #ffa800;
}
.support.function {
  color: #43d4c0;
}
.support.function.any-method {
  color: #0089ff;
}
.entity.name.function {
  color: #0089ff;
}
.entity.name.class,
.entity.name.type.class {
  color: #ffa800;
}
.entity.name.section {
  color: #0089ff;
}
.entity.name.tag {
  color: #de6262;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #f2883f;
}
.entity.other.attribute-name.id {
  color: #0089ff;
}
.meta.class {
  color: #ffa800;
}
.meta.link {
  color: #f2883f;
}
.meta.require {
  color: #0089ff;
}
.meta.selector {
  color: #e57dff;
}
.meta.separator {
  background-color: #373b41;
  color: #dfe1e0;
}
.none {
  color: #dfe1e0;
}
.markup.bold {
  color: #f2883f;
  font-weight: bold;
}
.markup.changed {
  color: #e57dff;
}
.markup.deleted {
  color: #de6262;
}
.markup.italic {
  color: #e57dff;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #0089ff;
}
.markup.inserted {
  color: #5acd00;
}
.markup.list {
  color: #de6262;
}
.markup.quote {
  color: #f2883f;
}
.markup.raw.inline {
  color: #5acd00;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #5acd00;
}
.c.punctuation.section.block.begin {
  color: #ffffff;
}
.c.punctuation.section.block.end {
  color: #ffffff;
}
.c.punctuation {
  color: #de6262;
}
.cpp.operator {
  color: red;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
